import React, {useEffect, useState} from 'react'
import LoadingPlane from './LoadingPlane'

const ListRandom = () => {
  const [loading, setLoading] = useState(false)
  const [randomNsn, setRandomNsn] = useState()

  const fetchRandom = async ()=> {
      setLoading(true)
      await fetch('/api/random_list')
      .then(res => res.json())
      .then(data => {
        setRandomNsn(data)
        setLoading(false)
      })
      .catch(err => console.log(err))
  }

  const nsnList = (
    <ul className='nsn-list'>
        {randomNsn ? randomNsn.map(obj => {
          <li><a>obj.nsn</a></li>
        }) : undefined}
    </ul>
  )

  useEffect(()=>{
    fetchRandom()
  }, [])


  return ( 
    <div>
      Random List of 15 NSN
      {loading ? <LoadingPlane /> : nsnList}
    </div>
   );
}
 
export default ListRandom;
